import os

for dirname, _, filenames in os.walk('/kaggle/input'):

    for filename in filenames:

        print(os.path.join(dirname, filename))



# Any results you write to the current directory are saved as output.
df = pd.read_csv("/kaggle/input/covid19zgonypolska/covid19-zgony-polska.csv", delimiter=";", header=0)

df.head()
px.histogram(df, x='wiek', color='płeć')
seaborn.set(rc={'axes.facecolor':'cyan', 'figure.facecolor':'cyan'})

sns.countplot(df["wiek"])

plt.xticks(rotation=90)

plt.show()
fig = px.bar(df, x= "wiek", y= "miejscowość", color_discrete_sequence=['crimson'],)

fig.show()
cnt_srs = df['miejscowość'].value_counts().head()

trace = go.Bar(

    y=cnt_srs.index[::-1],

    x=cnt_srs.values[::-1],

    orientation = 'h',

    marker=dict(

        color=cnt_srs.values[::-1],

        colorscale = 'redor',

        reversescale = True

    ),

)



layout = dict(

    title='Covid-19 Zgony Polska',

    )

data = [trace]

fig = go.Figure(data=data, layout=layout)

py.iplot(fig, filename="miejscowość")
fig = px.bar(df, 

             x='wiek', y='płeć', color_discrete_sequence=['#27F1E7'],

             title='Covid-19 Zgony Polska', text='wiek')

fig.show()
fig = px.line(df, x="wiek", y="płeć", color_discrete_sequence=['crimson'],  

              title="Covid-19 Zgony Polska")

fig.show()
from wordcloud import WordCloud

def nonan(x):

    if type(x) == str:

        return x.replace("\n", "")

    else:

        return ""



text = ' '.join([nonan(abstract) for abstract in df["miejscowość"]])

wordcloud = WordCloud(max_font_size=None,colormap='Set3', background_color='black', collocations=False,

                      width=1200, height=1000).generate(text)

fig = px.imshow(wordcloud)

fig.update_layout(title_text='Covid-19 Zgony Polska')
